import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => (
  <nav>
    <NavbarAuth />
  </nav>
);

const NavbarAuth = () => (
  <ul>
    <li>
      <NavLink to="/" exact>
        Hi, User!
      </NavLink>
    </li>
    <li>
      <NavLink to="/">
        Dashboard
      </NavLink>
    </li>
    <li></li>
    <li>
      <button>Signout</button>
    </li>
  </ul>
);

export default Navbar;
